import "./App.css";
import { Carousel } from "./components/carousel/Carousel.js";
import Slide1 from "./components/slide1/Slide1";

export default function App() {
  return (
    <Carousel>
      <Slide1 className="item-1"/>
      <div className="item item-2">Slied 2</div>
      <div className="item item-3">Slied 3</div>
    </Carousel>
  );
}
